@bot.message_handler(commands=['start'])
def start_message(message):
    markup = types.InlineKeyboardMarkup()
    markup.add(types.InlineKeyboardButton("English🇬🇧", callback_data="English🇬🇧"))
    markup.add(types.InlineKeyboardButton("Russian🇷🇺", callback_data="Russian🇷🇺"))

    bot.send_message(message.chat.id, text = "Welcome to the bot that will help you choose a movie for the evening based on your preferences. To continue please select a language.\n\n-----------------------------------------\n\nДобро пожаловать в бот, который поможет вам выбрать фильм на вечер исходя из ваших предпочтений. Чтобы продолжить, выберите язык.", reply_markup=markup)

@bot.callback_query_handler(func=lambda callback: callback.data)
def check_callback_data(callback):
    global bot_pay_token, user_arrey
    if callback.data == "English🇬🇧":
        user_arrey.update({callback.message.chat.id:{"leng":"EN"}})
        bot.send_message(callback.message.chat.id, text = "Excellent. Please subscribe to the channels or pay for a lifetime subscription to find movies for a fun and enjoyable evening.")
        
        markup = types.InlineKeyboardMarkup()
        markup.add(types.InlineKeyboardButton("Subscribe to sponsors", callback_data="Subscribe to sponsors"))
        markup.add(types.InlineKeyboardButton("Pay for a lifetime subscription", callback_data="Pay for a lifetime subscription"))

        bot.send_message(callback.message.chat.id, text = "Choose a method to access the channel.", reply_markup=markup)

    if callback.data == "Russian🇷🇺":
        user_arrey.update({callback.message.chat.id:{"leng":"RU"}})
        bot.send_message(callback.message.chat.id, text = "Отличный. Подпишитесь на каналы или оплатите пожизненную подписку, чтобы найти фильмы для веселого и приятного вечера.")

        markup = types.InlineKeyboardMarkup()
        markup.add(types.InlineKeyboardButton("Подписаться на спонсоров", callback_data="Подпишитесь на спонсоров"))
        markup.add(types.InlineKeyboardButton("Оплатить пожизненную подписку", callback_data="Оплатить пожизненную подписку"))

        bot.send_message(callback.message.chat.id, text = "Выберите способ для получения доступа к каналу.", reply_markup=markup)

    if callback.data == "Подпишитесь на спонсоров":
        markup = types.InlineKeyboardMarkup()
        markup.add(types.InlineKeyboardButton("Кладовая Книг", url='t.me/book_to_programmers'))
        markup.add(types.InlineKeyboardButton("Проверить подписку", callback_data="Проверить подписку"))
        
        bot.send_message(callback.message.chat.id, text = "Наши спонсоры. Подпешитесь на них чтобы продолжить.", reply_markup=markup)

    if callback.data == "Оплатить пожизненную подписку":
        bot.send_invoice(callback.message.chat.id, "Оформление пожизненной подписки на бота", "Получить пожизненную подписку на бота", "invoice", bot_pay_token, 'USD', [types.LabeledPrice("Купить пожизненную подписку", 5*100)])

    if callback.data == "Subscribe to sponsors":
        markup = types.InlineKeyboardMarkup()
        markup.add(types.InlineKeyboardButton("Book Pantry", url='t.me/book_to_programmers'))
        markup.add(types.InlineKeyboardButton("Check subscription", callback_data="Check subscription"))
        
        bot.send_message(callback.message.chat.id, text = "Our sponsors. Follow them to continue.", reply_markup=markup)
    
    if callback.data == "Pay for a lifetime subscription":
        bot.send_invoice(callback.message.chat.id, "Signing up for a lifetime subscription to the bot", "Get a lifetime subscription to the bot", "invoice", bot_pay_token, 'USD', [types.LabeledPrice("Buy a lifetime subscription", 5*100)])

    if callback.data == "Check subscription":

        check = bot.get_chat_member(-1001607793868, callback.message.chat.id)
        if check.status == "member" or check.status == "creator":

            markup = types.ReplyKeyboardMarkup(resize_keyboard=True, row_width=1)
            btn1 = types.KeyboardButton("Find a movie by code from Tik Tok")
            btn2 = types.KeyboardButton("Choose a random movie according to your preferences")
            btn3 = types.KeyboardButton("List of films from our top")
            markup.add(btn1, btn2, btn3)

            bot.send_message(callback.message.chat.id, text = "Thanks for subscribing to our sponsors, you can now use the bot.", reply_markup=markup)
